import './login.css';
import "react-bootstrap-carousel/dist/react-bootstrap-carousel.css";
import React from "react";

export function Login() {
    return (
        <div className='container-fluid d-flex'>
            <div className='container height ml-5 pl-5'>
                <div className='container-fluid'>
                    <h2 className='text-white mb-3'>Welcome back</h2>
                    <p className='text-white mb-4'>Welcome back! Please enter your details</p>
                    <div>
                        <button className='button py-5'>
                            Sign In
                        </button>
                    </div>
                </div>
            </div>
            <div className='container height bg-light'>
                <p className='color-white'>Hello world!</p>
            </div>
        </div>
    );
}
